// SPDX-License-Identifier: MIT
pragma solidity 0.8.4;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/proxy/Clones.sol";
import "./interface/IRandom.sol";
import "./interface/IPool.sol";

contract PoolFactory is Ownable {

    event PoolCreated(address pool, uint256 startDate, uint256 participationEndDate, uint256 endDate, uint256 participationAmount);

    address public poolToken;
    address public tokenCompound;
    address public poolImplementation;
    IRandom private random;

    address[] public registry;

    constructor(address poolToken_, address tokenCompound_, address poolImplementation_, address _random) {
        poolToken = poolToken_;
        tokenCompound = tokenCompound_;
        poolImplementation = poolImplementation_;
        random = IRandom(_random);
    }

    /**
     * createPool creates pool which integrate with compound's staking
     * startDate is date of starting pool, from this date pool's functions enable
     * participationEndDate is date after which the play function is not available
     * endDate is date of pool's end, enable to choose winner after this date
     * participationAmount is required amount for participation
     * isLottery if true it is a lottery pool, otherwise it is a savings pool
     */
    function createPool(uint256 startDate, uint256 participationEndDate, 
            uint256 endDate, uint256 participationAmount, bool isLottery) external onlyOwner {

        address pool = Clones.clone(poolImplementation);
        IPool(pool).initialize(poolToken, tokenCompound, startDate, participationEndDate, endDate, participationAmount, isLottery);
        registry.push(pool);
        emit PoolCreated(pool, startDate, participationEndDate, endDate, participationAmount);
    }

    function registryLength() external view returns (uint256) {
        return registry.length;
    }

    /**
     * play spends user money to compound mint
     * pool is address of pool
     */
    function participate(address pool) external {
        random.regenerateHash();
        IPool(pool).participate(msg.sender);
    }

    /**
     * setWinner set pool's winner, redeem all assets from compound
     * pool is address of pool
     */
    function liquidate(address pool) external onlyOwner {
        IPool ipool = IPool(pool);
        if (ipool.isLottery()) {
            ipool.liquidateWithWinner(random.rand(ipool.participantsLength()));
        } else {
            ipool.liquidate();
        }

    }

    /**
     * claim transfer asset from selt to user, winner also receive additional reward
     * pool is address of pool
     */
    function claim(address pool) external {
        random.regenerateHash();
        IPool(pool).claim(msg.sender);
    }
}
